button.onclick:
///$debug

// build PDF document
var document = new PdfDocument();
//document.getPageSize().setBackgroundColor(new java.awt.Color(250,250,250));
var dn = meibo.getCurrentDn();
document.open("Report " + meibo.getFieldValue("TRT_ID"));

var template = meibo.createPdfView(document, "Report", "Print", dn);
template.scale(40);
//var table = new PdfTable(1);
//table.addCell(template);
//PdfDocument.addAuthor()
//PdfDocument.newPage()
document.add(template);
//document.add(table);
document.close();

// send PDF file to browser
var response = new HttpResponse(document.getMimeType());
response.setAttachmentFile("Report " + meibo.getFieldValue("TRT_ID") + ".pdf");
response.append(document.toByteArray());
meibo.setHttpResponse(response);
